570	{"name": "Gail Erwin", "email": "gail@sanjoaquinhistory.org", "message": "I am the archivist for the San Joaquin County Historical Society & Museum. Recently we were offered the donation of an 1865 store ledger. At the top of each page is written \\"Lodi O\\" and then the date. It is dated from January 1 to June 20. Our address is outside of Lodi, California. The donor said that his grandmother, a local history lover and booster, had had this ledger in her things when she passed, but she didn't pass any information on about where or how she had acquired it. I went through it to see if any local settlers from our county were mentioned but found none that were familiar. However, I did find Nelson Harris, among other names. In doing a little online sleuthing, I learned that a Nelson Harris, 1831-1915, was buried at the Woodlawn Cemetery in Lodi, Medina County, Ohio, and he had been a merchant. My understanding is that his grandfather, Judge Joseph Harris, settled in the township before 1812, and his father Albert had been a merchant around 1865. I may have some of this information jumbled up, but it sounds as if this ledger came from Lodi, Ohio. If the donor is agreeable to it, are you interested in adding it to your collections? I'll be glad to send you more names from the ledger and a photo, if you like."}	2024-03-26 19:24:00.599074-04	10
